CREATE TABLE src.schools_districts (
	school_name text NULL,
	state_name text NULL,
	school_id int8 NULL,
	district_name text NULL,
	agency_id int8 NULL,
	school_type text NULL,
	agency_type text NULL,
	charter_school text NULL,
	latitude float8 NULL,
	longitude float8 NULL,
	congressional_code int8 NULL,
	national_school_lunch_program text NULL
);

